import React from 'react';
import { Send, Paperclip, Image, Layout, Home, Settings as SettingsIcon, Users, FileText } from 'lucide-react';
import { Routes, Route, NavLink } from 'react-router-dom';
import './Dashboard.css';
import './Navbar.css';
import './Sidebar.css';

// Placeholder components for different dashboard sections
const TestCases = () => <div>Test Cases Management</div>;
const UserManagement = () => <div>User Management</div>;
const ApplicationSettings = () => <div>Application Settings</div>;

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src="/logo.png" alt="QA Agent Logo" />
      </div>
      <div className="navbar-actions">
        <button className="navbar-button">
          <Users />
          Profile
        </button>
        <button className="navbar-button">
          <SettingsIcon />
          Settings
        </button>
      </div>
    </nav>
  );
};

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-menu">
        <NavLink to="/dashboard/home" className="sidebar-item" activeClassName="active">
          <Home />
          <span>Home</span>
        </NavLink>
        <NavLink to="/dashboard/test-cases" className="sidebar-item" activeClassName="active">
          <FileText />
          <span>Test Cases</span>
        </NavLink>
        <NavLink to="/dashboard/user-management" className="sidebar-item" activeClassName="active">
          <Users />
          <span>User Management</span>
        </NavLink>
        <NavLink to="/dashboard/settings" className="sidebar-item" activeClassName="active">
          <SettingsIcon />
          <span>Settings</span>
        </NavLink>
      </div>
    </div>
  );
};

const Dashboard = () => {
  const suggestedPrompts = {
    'Automate Case generation': [
      'Create a test case for signup page',
      'Create a test case for user is able to click on input field',
      'Test Case For Role Management'
    ],
    'Test Case Execution': [
      'Create a check list for Role management test cases',
      'Create a Checklist for Signup page',
      'Test Case For Role Management'
    ],
    'Code Import and Upload': [
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit.',
      'Lorem ipsum dolor sit amet, conse',
      'Lorem Ipsum Dolor Sit Amet.'
    ]
  };

  const PromptCard = ({ text }) => (
    <div className="prompt-card">
      <span className="prompt-text">{text}</span>
      <span className="arrow-icon">
        <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
          <path d="M9 5l7 7-7 7" />
        </svg>
      </span>
    </div>
  );

  return (
    <div className="dashboard-layout">
      <Navbar />
      <div className="dashboard-content">
        <Sidebar />
        <main className="main-content">
          <Routes>
            <Route path="home" element={
              <div className="dashboard-container">
                {/* Header */}
                <div className="header">
                  <h1 className="main-title">
                    Unveiling the Power of Test Case Generation and Execution
                  </h1>
                  <p className="subtitle">
                    Software testing with automated case generation, execution, and meticulous scrutiny, ensuring precision and efficiency in development workflows.
                  </p>
                </div>

                {/* Suggested Prompts Section */}
                <div className="prompts-section">
                  <div className="prompts-header">
                    <span className="sparkle">âœ¨</span>
                    <h2 className="section-title">Suggested Prompts</h2>
                  </div>

                  <div className="prompts-grid">
                    {Object.entries(suggestedPrompts).map(([category, prompts]) => (
                      <div key={category} className="category-card">
                        <h3 className="category-title">{category}</h3>
                        {prompts.map((prompt, index) => (
                          <PromptCard key={index} text={prompt} />
                        ))}
                      </div>
                    ))}
                  </div>
                </div>

                {/* Input Section */}
                <div className="input-section">
                  <div className="input-container">
                    <input
                      type="text"
                      placeholder="How can I help you?"
                      className="main-input"
                    />
                    <div className="action-buttons">
                      <button className="icon-button">
                        <Paperclip className="icon" />
                      </button>
                      <button className="icon-button">
                        <Image className="icon" />
                      </button>
                      <button className="icon-button">
                        <Layout className="icon" />
                      </button>
                      <button className="send-button">
                        <Send className="send-icon" />
                        Send
                      </button>
                    </div>
                  </div>
                </div>
              </div>
            } />
            <Route path="test-cases" element={<TestCases />} />
            <Route path="user-management" element={<UserManagement />} />
            <Route path="settings" element={<ApplicationSettings />} />
          </Routes>
        </main>
      </div>
    </div>
  );
};

export default Dashboard;
